import React from 'react';
import { Layout, Table, Icon } from 'antd';

const dataSource = [
  {
    key: '1',
    file: '2020-01-09.csv',
  },
  {
    key: '2',
    file: '2020-01-08.csv',
  },
];

const columns = [
  {
    title: 'File',
    dataIndex: 'file',
    key: 'file',
  },
  {
    title: 'Action',
    key: 'actions',
    render: (text, record) => (
      <span>
        <Icon type="download" theme="twoTone" />
        <a href="" >Download</a>
      </span>
    )
  },

];

const Reports = () =>
  <>
  <Layout style={{ margin: 20, background: 'white'}}>
    <section style={{textAlign: 'left'}}>
      <h1 style={{textAlign: 'left'}}>Reports</h1>
    </section>
    <Table dataSource={dataSource} columns={columns} />
  </Layout>
  </>

export default Reports
